import React from 'react';
import Rotas from './routes';
import './Global.css';

import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
            <Routes>
                <Route path="/" exact element={<Login/>} />
            </Routes>
        </BrowserRouter>
  );
}

export default App;
